import React from "react";
import { Route, Switch } from "react-router-dom";
import Three from "./components/three";
import Carry from "./components/carrybox/carry";

const App = () => {
  return (
    <Switch>
      <Route exact path="./components/control.js" component={Three} />
      <Route exact path="./components/carrybox/carry.js" component={Carry} />
    </Switch>
  );
};

export default App
